import { useLocation } from 'react-router';
import { Link } from 'react-router-dom';

// \u521B\u5EFA\u4E00\u4E2A\u7EC4\u4EF6\uFF0C\u6CE8\u610F\u5BF9 children \u7684\u6E32\u67D3
const MyProvider = (props) => {
  const { children, name } = props;
  const location = useLocation();
  if (location.pathname === '/about') {
    return (
      <div>
        \u5185\u5BB9\u88AB\u62E6\u622A\u4E86\uFF0C\u8FD4\u56DE <Link to={'/'}>Home</Link>
      </div>
    );
  }
  return (
    <div>
      <div>Hello {name}</div>
      <Link to={'/'}>Home</Link>, <Link to={'/about'}>About</Link>
      {children}
    </div>
  );
};

class PluginSampleProvider extends Plugin {
  async load() {
    this.app.addProvider(MyProvider);
    this.app.router.add('home', {
      path: '/',
      Component: () => <div>Home page</div>,
    });
  }
}

const app = new Application({
  router: {
    type: 'memory',
    initialEntries: ['/'],
  },
  plugins: [PluginSampleProvider],
});

export default app.getRootComponent();`},"@nocobase/client":{type:"NPM",value:"0.17.0-alpha.1"},"react-router":{type:"NPM",value:"6.3.0"},"react-router-dom":{type:"NPM",value:"6.3.0"}}}}},rl={title:"Provider component",toc:"menu",filename:"docs/en-US/development/client/providers.md",lastUpdated:1701741378e3,description:"Sorry, this document is not available in English."},Kl=[{id:"provider-component",depth:1,title:"Provider component"},{id:"\u63D0\u4F9B\u5168\u5C40\u5171\u4EAB\u7684\u4E0A\u4E0B\u6587",depth:2,title:"\u63D0\u4F9B\u5168\u5C40\u5171\u4EAB\u7684\u4E0A\u4E0B\u6587"},{id:"\u63D0\u4F9B\u5168\u5C40\u5185\u5BB9\u5C55\u793A",depth:2,title:"\u63D0\u4F9B\u5168\u5C40\u5185\u5BB9\u5C55\u793A"},{id:"\u62E6\u622A\u4F5C\u7528",depth:2,title:"\u62E6\u622A\u4F5C\u7528"}],ui=[{value:"Sorry, this document is not available in English.",paraId:0},{value:"\u5728 NocoBase \u5BA2\u6237\u7AEF\u5E94\u7528\u91CC\uFF0CProvider \u7EC4\u4EF6\u5728\u5916\u5C42\u5B9A\u4E49\uFF0C\u6838\u5FC3\u7ED3\u6784\u5982\u4E0B\uFF1A",paraId:1},{value:`<Router>
